"use strict";

(function init100vh() {
  function setHeight() {
    var vh = window.innerHeight * 0.01;
    document.documentElement.style.setProperty('--vh', "".concat(vh, "px"));
  }
  setHeight();
  window.addEventListener('resize', setHeight);
})();
window.addEventListener('orientationchange', function () {
  location.reload(true);
});

// padding no-ios
document.addEventListener('DOMContentLoaded', function () {
  var date = document.querySelector('.reg__date');
  var time = document.querySelector('.reg__time');
  var teams = document.querySelectorAll('.reg__team');
  var mid = document.querySelector('.footer__mid');
  if (!/iPad|iPhone|iPod|Mac/.test(navigator.userAgent)) {
    date.classList.add('noios-padding');
    time.classList.add('noios-padding');
    teams.forEach(function (team) {
      team.classList.add('noios-padding');
    });
    mid.classList.add('noios-padding');
  }
});
